import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import App from '../App';
import HomePage from '../pages/HomePage';
import SignUpPage from '../pages/login/SignUpPage';
import LogInPage from '../pages/login/LogInPage';
import PersonalZonePage from '../pages/PersonalZonePage';
import NavBar from '../common/components/NavBar';

function AppRoutes() {
  const [authToken, setAuthToken] = React.useState(null);

  return (
    <Router>
      <NavBar authToken={authToken} setAuthToken={setAuthToken} />
      <Routes>
        <Route exact path="/" element={<HomePage />} />
        <Route path="/login" element={<LogInPage setAuthToken={setAuthToken} />} />
        <Route path="/signup" element={<SignUpPage setAuthToken={setAuthToken} />} />
        <Route path="/PersonalZone/:token" element={<PersonalZonePage />} />
        <Route path="/app" element={<App />} />
      </Routes>
    </Router>
  );
}

export default AppRoutes;
